function validate_plicence()
{
	if(document.getElementById("type1").value=="I"){
		var type1 = 'Issue';
	} else if(document.getElementById("type1").value=="R"){
		var type1 = 'Renewal';
	}
	if(document.getElementById("state").value==0){
		alert("* Please select state name !!");
		document.getElementById("state").focus();
		return false;
	}
	if(document.getElementById("licenceNo").value==""){
		alert("* Please input licence no. !!");
		document.getElementById("licenceNo").focus();
		return false;
	}
	if(document.getElementById("validUpTo").value==""){
		alert("* Please input licence validity date !!");
		document.getElementById("validUpTo").focus();
		return false;
	} else if(document.getElementById("validUpTo").value!=""){
		if(!checkdate(document.plicence.validUpTo)){
			document.getElementById("validUpTo").focus();
			return false;
		}
	}
/*	if(document.getElementById("issueNo").value==""){
		alert("* Please input licence "+type1+" no. !!");
		document.getElementById("issueNo").focus();
		return false;
	}
	if(document.getElementById("issueDate").value==""){
		alert("* Please input licence "+type1+" date !!");
		document.getElementById("issueDate").focus();
		return false;
	}*/
	if(document.getElementById("issueDate").value!=""){
		if(!checkdate(document.plicence.issueDate)){
			document.getElementById("issueDate").focus();
			return false;
		}
		var no_of_days = getDaysbetween2Dates(document.plicence.issueDate,document.plicence.validUpTo);
		if(no_of_days < 0){
			alert("* Sorry! "+type1+" and/or validity date wrongly selected.\nPlease correct and submit again.\n");
			document.getElementById("issueDate").focus();
			return false;
		}
	}
}

function get_type(me)
{
	if(me=="I"){
		document.getElementById("spanID1").innerHTML='Issue';
		document.getElementById("spanID2").innerHTML='Issue';
	} else if(me=="R"){
		document.getElementById("spanID1").innerHTML='Renewal';
		document.getElementById("spanID2").innerHTML='Renewal';
